import {BrowserRouter, Switch, Route} from 'react-router-dom'
import Navbar from './componentsJs/Navbar';


function App() {
  return (
    <div className="container-fluid">
      <div className="container">
      <BrowserRouter>
    <Switch>
      <Route path="/" exact component={Navbar}/>

    </Switch>
    </BrowserRouter>
      </div>
    </div>

  );
}

export default App;
